import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './TransactionForm.css';

const TransactionForm = ({ onClose, onSubmit, isSubmitting }) => {
  const [formData, setFormData] = useState({
    type: 'expense',
    amount: '',
    description: '',
    category: '',
    date: new Date().toISOString().split('T')[0]
  });
  const [error, setError] = useState('');

  // Auto-categorize when description changes
  useEffect(() => {
    const timer = setTimeout(() => {
      if (formData.description && !formData.category) {
        autoCategorize(formData.description);
      }
    }, 1000); // 1 second delay

    return () => clearTimeout(timer);
  }, [formData.description]);

  const autoCategorize = async (description) => {
    try {
      const response = await axios.post('http://localhost:8000/api/categorize/', {
        description: description
      });
      setFormData(prev => ({
        ...prev,
        category: response.data.category
      }));
    } catch (err) {
      console.log('Auto-categorization failed:', err);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.amount || !formData.description) {
      setError('Amount and description are required');
      return;
    }
    onSubmit(formData);
  };

  return (
    <div className="modal-overlay">
      <div className="modal">
        <div className="modal-header">
          <h2>Add Transaction</h2>
          <button onClick={onClose} disabled={isSubmitting}>&times;</button>
        </div>
        
        {error && <div className="form-error">{error}</div>}

        <form onSubmit={handleSubmit}>
          {/* Type Radio Buttons */}
          <div className="form-group">
            <label>Type</label>
            <div className="radio-group">
              <label>
                <input
                  type="radio"
                  name="type"
                  value="expense"
                  checked={formData.type === 'expense'}
                  onChange={handleChange}
                /> Expense
              </label>
              <label>
                <input
                  type="radio"
                  name="type"
                  value="income"
                  checked={formData.type === 'income'}
                  onChange={handleChange}
                /> Income
              </label>
            </div>
          </div>

          {/* Amount Field */}
          <div className="form-group">
            <label>Amount</label>
            <input
              type="number"
              name="amount"
              value={formData.amount}
              onChange={handleChange}
              step="0.01"
              min="0"
              required
            />
          </div>

          {/* Description Field */}
          <div className="form-group">
            <label>Description</label>
            <input
              type="text"
              name="description"
              value={formData.description}
              onChange={handleChange}
              required
            />
          </div>

          {/* Category Field */}
          <div className="form-group">
            <label>Category</label>
            <select
              name="category"
              value={formData.category}
              onChange={handleChange}
              required
            >
              <option value="">Select a category</option>
              <option value="food">Food</option>
              <option value="transportation">Transportation</option>
              <option value="housing">Housing</option>
              <option value="entertainment">Entertainment</option>
              <option value="utilities">Utilities</option>
              <option value="health">Health</option>
              <option value="education">Education</option>
              <option value="other">Other</option>
            </select>
            {formData.category && (
              <small>AI Suggested: {formData.category}</small>
            )}
          </div>

          {/* Date Field */}
          <div className="form-group">
            <label>Date</label>
            <input
              type="date"
              name="date"
              value={formData.date}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-actions">
            <button type="button" onClick={onClose} disabled={isSubmitting}>
              Cancel
            </button>
            <button type="submit" disabled={isSubmitting}>
              {isSubmitting ? 'Submitting...' : 'Submit'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default TransactionForm;
